":"Esri","units":null,"decimals":null,"definition":"The Esri 2020-2025 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2020 and 2025. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKAVGHHSZ_CY":{"type":"number","alias":"2025 Average Household Size","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2025 Diversity Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2025 Median Age","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINC_CY":{"type":"number","alias":"2025 Median Household Income","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOMEVALUEMEDVAL_CY":{"type":"number","alias":"2025 Median Home Value","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"NETWORTHMEDNW_CY":{"type":"number","alias":"2025 Median Net Worth","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEDEPENDENCYCHILD_CY_P":{"type":"number","alias":"2025 Child Population: Percent","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the total Child Population (Age 0-17) in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_1YEARINCREMENTSAGE18_CY_P":{"type":"number","alias":"2025 Population Age 18: Percent","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Total Population Age 18 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic va 2025 estimate of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY":{"id":"DIVINDX_CY","fullName":"KeyUSFacts.DIVINDX_CY","alias":"2025 Diversity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY":{"id":"MEDAGE_CY","fullName":"5yearincrements.MEDAGE_CY","alias":"2025 Median Age","fieldName":"_5YEARINCREMENTSMEDAGE_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Age of the population in the geographic area. See <a target='_blank' ed Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.NETWORTHMEDNW_CY":{"id":"MEDNW_CY","fullName":"networth.MEDNW_CY","alias":"2025 Median Net Worth","fieldName":"NETWORTHMEDNW_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.NETWORTHMEDNW_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.AGEDEPENDENCYCHILD_CY_P":{"id":"CHILD_CY_P","fullName":"AgeDependency.CHILD_CY_P","alias":"2025 Child Population: Percent","fieldName":"AGEDEPENDENCYCHILD_CY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEDEPENDENCYCHILD_CY_P","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the total Child Population (Age 0-17) in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._1YEARINCREMENTSAGE18_CY_P":{"id":"AGE18_CY_P","fullName":"1yearincrements.AGE18_CY_P","alias":"2025 Population Age 18 (%)","fieldName":"_1YEARINCREMENTSAGE18_CY_P","precision":2,"calculatorName":"dataCol
